import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import under_navbar from './under_navbar';


const root = ReactDOM.createRoot(document.getElementById('root'));
const under_root = ReactDOM.createRoot(document.getElementById('under_root'));

root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

under_root.render(

    <under_navbar/>

);
